import React from 'react';
import ReactDOM from 'react-dom';
import admin from './img/admin.jpg'

const App = () => {
    return(
        <div>
            <img src={admin} alt='Admin'></img>
        </div>
    )
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
